import React, { useState } from 'react';
import './GridEntry.scss';
import ArrowForwardIosIcon from '@mui/icons-material/ArrowForwardIos';
import ArrowBackIosNewIcon from '@mui/icons-material/ArrowBackIosNew';

// Official 2026 Lineups
const f1Data: { [key: string]: string[] } = {
  "McLaren": ["Lando Norris", "Oscar Piastri"],
  "Ferrari": ["Charles Leclerc", "Lewis Hamilton"],
  "Red Bull": ["Max Verstappen", "Isack Hadjar"],
  "Mercedes": ["George Russell", "Kimi Antonelli"],
  "Aston Martin": ["Fernando Alonso", "Lance Stroll"],
  "Audi": ["Nico Hülkenberg", "Gabriel Bortoleto"],
  "Williams": ["Alex Albon", "Carlos Sainz"],
  "Alpine": ["Pierre Gasly", "Franco Colapinto"],
  "Haas": ["Esteban Ocon", "Oliver Bearman"],
  "Racing Bulls": ["Liam Lawson", "Arvid Lindblad"],
  "Cadillac": ["Sergio Pérez", "Valtteri Bottas"]
};

const GridEntry = () => {
  const [step, setStep] = useState(1);
  const [formData, setFormData] = useState({ name: '', team: '', driver: '' });

  const handleTeamChange = (e: React.ChangeEvent<HTMLSelectElement>) => {
    // When team changes, we reset the driver to ensure they choose a valid one for the new team
    setFormData({ ...formData, team: e.target.value, driver: '' });
  };

  const handleInputChange = (e: React.ChangeEvent<HTMLInputElement | HTMLSelectElement>) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  return (
    <div className="grid-entry-container" id="contact" style={{ backgroundColor: '#FAFAF8', padding: '100px 10%' }}>
      <div className="main-content-area" style={{ display: 'flex', justifyContent: 'center' }}>
        <div className="f1-terminal" style={{ 
          backgroundColor: '#1E1E1E', width: '100%', maxWidth: '800px', 
          minHeight: '450px', borderRadius: '4px', padding: '40px', position: 'relative',
          boxShadow: '20px 20px 0px #FF7A1A'
        }}>

          {step === 1 ? (
            <div className="terminal-content">
              <h2 style={{ color: '#FF7A1A', fontFamily: 'monospace', marginBottom: '20px' }}>{'>'} MISSION_OBJECTIVE</h2>
              <p style={{ color: '#FAFAF8', lineHeight: '1.8', fontSize: '1.1rem', marginBottom: '30px' }}>
                Engineering is a race for precision. In the 2026 technical era, data determines the winner. 
                Register your prediction below to join the digital pit wall.
              </p>
              <button 
                onClick={() => setStep(2)}
                style={{ 
                  background: 'none', border: '1px solid #FF7A1A', color: '#FF7A1A', 
                  padding: '10px 20px', cursor: 'pointer', display: 'flex', alignItems: 'center', gap: '10px',
                  fontWeight: 800, fontFamily: 'monospace'
                }}
              >
                ENTER TECHNICAL SPECS <ArrowForwardIosIcon style={{ fontSize: '14px' }} />
              </button>
            </div>
          ) : (
            <div className="terminal-content">
              <button onClick={() => setStep(1)} style={{ background: 'none', border: 'none', color: '#6B7280', cursor: 'pointer', marginBottom: '20px', fontWeight: 800 }}>
                <ArrowBackIosNewIcon style={{ fontSize: '12px' }} /> BACK
              </button>
              <h2 style={{ color: '#FF7A1A', fontFamily: 'monospace', marginBottom: '30px' }}>{'>'} STRATEGIST_REGISTRATION</h2>

              <div style={{ display: 'grid', gap: '20px' }}>
                <div style={{ display: 'flex', flexDirection: 'column' }}>
                  <label style={{ color: '#6B7280', fontSize: '0.8rem', marginBottom: '5px', fontWeight: 800 }}>USER_ID (NAME)</label>
                  <input name="name" value={formData.name} onChange={handleInputChange} style={{ background: '#2C2C2C', border: 'none', color: '#FAFAF8', padding: '10px' }} />
                </div>

                {/* 1. Select Team First */}
                <div style={{ display: 'flex', flexDirection: 'column' }}>
                  <label style={{ color: '#6B7280', fontSize: '0.8rem', marginBottom: '5px', fontWeight: 800 }}>CONSTRUCTOR_SUPPORT (TEAM)</label>
                  <select name="team" value={formData.team} onChange={handleTeamChange} style={{ background: '#2C2C2C', border: 'none', color: '#FAFAF8', padding: '10px' }}>
                    <option value="">Select Team</option>
                    {Object.keys(f1Data).sort().map(team => (
                      <option key={team} value={team}>{team}</option>
                    ))}
                  </select>
                </div>

                {/* 2. Select Driver Based on Team */}
                <div style={{ display: 'flex', flexDirection: 'column' }}>
                  <label style={{ color: '#6B7280', fontSize: '0.8rem', marginBottom: '5px', fontWeight: 800 }}>PILOT_AUTHORIZATION (DRIVER)</label>
                  <select 
                    name="driver" 
                    value={formData.driver} 
                    onChange={handleInputChange} 
                    disabled={!formData.team} // Disabled until team is selected
                    style={{ 
                      background: formData.team ? '#2C2C2C' : '#1a1a1a', 
                      border: 'none', 
                      color: formData.team ? '#FAFAF8' : '#6B7280', 
                      padding: '10px',
                      cursor: formData.team ? 'pointer' : 'not-allowed'
                    }}
                  >
                    <option value="">{formData.team ? 'Select Driver' : 'Select Team First'}</option>
                    {formData.team && f1Data[formData.team].map(driver => (
                      <option key={driver} value={driver}>{driver}</option>
                    ))}
                  </select>
                </div>

                <button style={{ backgroundColor: '#FF7A1A', color: '#1E1E1E', fontWeight: 800, padding: '15px', border: 'none', cursor: 'pointer', marginTop: '10px', textTransform: 'uppercase' }}>
                  Lock Strategy & Deploy
                </button>
              </div>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default GridEntry;
